import './App.css';
import React, { Component } from 'react';

class Train extends Component {
  constructor(props) {
    super(props);

    fetch("http://api.bart.gov/api/etd.aspx?cmd=etd&key=MW9S-E7SL-26DU-VV8V&orig="+ "balb" + "&json=y")
      .then(res => res.json())
      .then(
        (result) => {
          this.setState({
            isLoaded: true,
            items: result.items
          });
        },
        // Note: it's important to handle errors here
        // instead of a catch() block so that we don't swallow
        // exceptions from actual bugs in components.
        (error) => {
          this.setState({
            isLoaded: true,
            error
          });
        }
      )
  }
  render() {
    return (
      <p>{this.state.items.root.station[0].etd[0].destination}</p>

      )
  }
}

function App() {
	return (
    <div id="root">
      <Train />
    </div>
    );
}


export default App;
